import React from "react";
import AppLayout from "../components/AppLayout";

import Head from 'next/head';


const SignUp = () => {
  return (
    <>
    <Head>
      <title>My  | NodeBird</title>
    </Head>
    <AppLayout></AppLayout>
      <div>Hello, SingUp</div>
    
    </>
  );
};

export default SignUp;
